import logo from './logo.svg';
import './App.css';
import TextField from '@mui/material/TextField';
import Checkbox from '@mui/material/Checkbox';

import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';



function App() {
  return (
    <div  >

<div className='body'>
  <TextField placeholder='First name' />
  </div>

<div className='body'><TextField  className='Textfield'  placeholder='Last name' /></div>

<div className='body'>
<div> Male : < Checkbox/> </div>

<div> Female : <Checkbox /> </div>
<div> Others : <Checkbox/> </div>

</div>

<div className='body'><TextField  className='Textfield'  placeholder='Nationality' /></div>

<div className='body'><TextField  className='Textfield'  placeholder='First name' /></div>
<div className='body'><TextField  className='Textfield'  placeholder='First name' /></div>
<div className='body'><TextField  className='Textfield'  placeholder='First name' /></div>

<FormControl sx={{ m: 1, minWidth: 120 }} >
        <InputLabel >Country</InputLabel>
        <Select>
          <MenuItem value={'India'}>India</MenuItem>
          <MenuItem value={'Afganistan'} >Afganisthan</MenuItem>
          <MenuItem value={'Thirty'}>Australia</MenuItem>
          <MenuItem value={'Thirty'}>Bangladesh</MenuItem>
          <MenuItem value={'Thirty'}>Brazil</MenuItem>
          <MenuItem value={'Thirty'}>China</MenuItem>
          <MenuItem value={'Thirty'}>France</MenuItem>
          <MenuItem value={'Thirty'}>China</MenuItem>


        </Select>
      </FormControl>


    </div>
  );
}

export default App;
